window.bookSummaryJSON = "<p>A new adventure awaits Allen as he enters the service of a noble!</p> <p>After climbing up the social ladder from serf to manservant, Allen now finds himself dragged around by the whims of the willful young lady of the house, Cecil Granvelle. Despite this, he is free to leave the city—and immerse himself in hunting monsters!</p> <p>As Allen meticulously grinds on goblins and orcs, both he and his Summons grow stronger by the day. At the same time, he begins to earn the trust of the members of House Granvelle with his diligent work ethic.</p> <p>Just as everything seems to be going well, however, the viscount overseeing the next fiefdom over seems to be up to something.</p> <p>As danger creeps toward Cecil, Allen declares, \"I promised to protect you, Lady Cecil. And I keep my promises.\"</p> <p>Going all out with his skills and Summons, Allen must resist evil and impending doom!</p>"; 
